Handritið var skrifað á Íslandi. Það er tímasett til miðrar 14. aldar (sbr. 
                           Stefán Karlsson 1967:27
                        ), en Kålund tímasetti til fyrri hluta aldarinnar (
                           Katalog over de oldnorsk-islandske
                              håndskrifter 1900:72
                        ).
